.navigation__wrapper {
  padding: 13px 0 0 8px;
  display: flex;
  justify-content: space-between;
  background-color: #fafafa;
  // border-bottom: #DBDBDB;
}

.menu__buttons {
  padding: 7px 0 7px 24px;
}

.btn {
  border: none;
  cursor: pointer;
  margin: 0 11px;
  padding: 0;
}

.btn__home {
  width: 22px;
  height: 22px;
  background: url(../../../assets/Icons/Home.svg);
}

.btn__home-active {
  background: url(../../../assets/Icons/Home-fill.svg);
}

.btn__messenger {
  width: 22px;
  height: 22px;
  background: url(../../../assets/Icons/Messenger.svg);
}

.btn__messenger-active {
  background: url(../../../assets/Icons/Messenger-Fill.svg);
}

.btn__post {
  width: 22px;
  height: 22px;
  background: url(../../../assets/Icons/NewPosts.svg);
}

.btn__activity {
  width: 22px;
  height: 22px;
  background: url(../../../assets/Icons/ActivityFeed.svg);
}

.btn__activity-active {
  background: url(../../../assets/Icons/ActivityFeed-Fiil.svg);
}

.btn__people {
  width: 22px;
  height: 22px;
  background: url(../../../assets/Icons/FindPeople.svg);
}

.btn__people-active {
  background: url(../../../assets/Icons/FindPeople-Fiil.svg);
}

.btn__my-profile {
  width: 22px;
  height: 22px;
  background: url(../../../assets/Icons/Profile-Pic-S.svg);
}

.btn__my-profile-active {
}

.btn:last-child {
  margin: 0 0 0 11px;
}

.btn:first-child {
  margin: 0 11px 0 0;
}

::placeholder {
  background: url(../../../assets/Icons/Search.svg);
  background-repeat: no-repeat;
  background-position: 35px;
  color: #8e8e8e;
  text-align: center;
}

.search__input {
  // background: url(../../../assets/Icons/Search.svg);
  // background-repeat: no-repeat;
  padding: 4px 30px;
  color: #8e8e8e;
  border: 1px solid #dbdbdb;
  border-radius: 3px;
}

hr.border {
  border: 1px solid #dbdbdb;
  margin: 0;
}

